import SHOP_DATA from "./shop-data.jsx"

const INITIAL_STATE = {
    collections: SHOP_DATA
}

const shopReducer = (state = INITIAL_STATE, action) => {
    console.log(state[0], action)
    switch (action.type) {
        default:
            return state
    }
}

export default shopReducer;
